import React from 'react';
import '../../App.css';
import Cards from '../Cards';

function Fun() {
  return (
      <>
          <h1 className='fun'>
            OTHER WORK \n
            <h1 className='fun-small'>Experimentation with a variety of mediums</h1>
          </h1>
          <Cards />
      </>
  );
}

export default Fun;
